import React from 'react';


const IdentitySection = ({ name, email, phone, handleInputChange }) => {
  return (
    <>
    <div className="row">
    <div className="col">
      <input
      className="form-control"
      name="name"
      placeholder="Name"
      required
      value={name}
      onChange={handleInputChange}
      />
      </div>
      </div>



      <div className="col">
      <input
      className="form-control"
      name="email"
      placeholder="you@example.com"
      required
      value={email}
      onChange={handleInputChange}
      />
      </div>


    <div className="col">
      <input
      className="form-control"
      name="phone"
      placeholder="Phone"
      required
      value={phone}
      onChange={handleInputChange}
      />
      </div>
    </>
  )
}

export default IdentitySection;
